import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div>
      <h1>Welcome to the Home Page</h1>
      <button onclick="http://localhost:3000/login">Log in</button>
      <br />
      <button onclick="http://localhost:3000/signup">Signup</button>
    </div>
  );
};

export default HomePage;
